import UserData from './components/UserData';

import React, { useState } from 'react';

function App() {


  let url = 'https://geektrust.s3-ap-southeast-1.amazonaws.com/adminui-problem/members.json';

  let usersDetails = [];
  const [fetchedData, setUserDetails] = useState(usersDetails);
  try {
    fetch(url).
      then(response => {
        return response.json();
      })
      // convert to json
      .then((data) => {
        setUserDetails(data);
        // for (let obj of data)
        usersDetails.push(data);

      });
    // console.log(usersDetails);
  } catch (error) {
    console.log(error);

  }
  console.log(fetchedData);
  // console.log(usersDetails.length);
  // setUserDetails(usersDetails);

  return (
    <div>
      <input type='text' className='searchBox' placeholder="Search" />
      <UserData items={fetchedData}></UserData>

    </div>
  );
}

export default App;
